import { Component } from "react";
import Profile from "../components/views/profile";
import Title from "../components/views/title";
import Paragraph from "../components/views/paragraph";

export default class View extends Component {
    render() {
        return (
            <div class="center view">
                <img alt="" src="https://img.icons8.com/ios-glyphs/30/ffffff/macos-close.png" class="right-top" onclick={this.props.click} />
                <Profile />
                <Title align="h2" title="Name" />
                <Paragraph align="unmargin" cont="Nothing to show" />
                <div class=" Glass-plate scrollview">
                    <div class="Glass-plate searchplate">
                        <div class="padding">
                        <Title title="Facebook" align="bold h1" />
                        <Profile />
                        <Title align="h2" title="Name" />
                        <Paragraph cont="Nothing to show" />
                        </div>
                    </div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                    <div class="Glass-plate searchplate"></div>
                </div>
            </div>
        );
    }
}
